import React, { useEffect, useState } from "react";

function Detalles(props) {
    const[detalle,setdetalle]= useState([])
    useEffect(()=>{
        obtenerDetalles()
      },[])
    const obtenerDetalles = async ()=>{
        const data = await fetch('http://hoteloasis.vicentealdhair.com/api/oasis/centro_consumo')
        const detalles =await data.json()
        setdetalle(detalles)
      }
  return (
    <div className="container__componente">
      <div className="container__detalles">
      <div className="scroll">
          <h2 className="titulo__restaurante">Restaurantes</h2>
        </div>
      <div className="container__contenido">
      return <h3>{props.mensaje}</h3>
      </div>
      </div>
    </div>
  );
}

export default Detalles;
